import * as React from 'react';
import { useNavigate } from 'react-router-dom';

import Paper from '@mui/material/Paper';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TablePagination from '@mui/material/TablePagination';
import TableRow from '@mui/material/TableRow';

import { useMediaQuery, Grid, Typography } from '@mui/material';
import TablesClientRow from './TablesClientRow';

export default function TablesClient(props) {

  const navigate = useNavigate()

  const isMediumDevice = useMediaQuery('(max-width:900px');

  const handleClickRow = (id) => {
    navigate('/personas/:' + id)
  }

  const tableHeaderStyle = {
    variant:'body1',
    style:{ fontWeight: '500' },
  }

  return (
    // <Paper sx={{ width: '100%', overflow: 'hidden' }}>
    <>
      <TableContainer sx={{ height: { xs: '62vh', md: '48vh' } }} >
        <Table stickyHeader aria-label="sticky table" size={isMediumDevice ? "medium" : "small"}  >

          <TableHead>
            <TableRow>
              {/* {!isMediumDevice && <TableCell align='left' style={{ minWidth: 20 }}> Avatar </TableCell>} */}
              <TableCell align='left' style={{ minWidth: 20 }}> <Typography {...tableHeaderStyle}>Id</Typography> </TableCell>
              <TableCell align='left' style={{ minWidth: 20 }}> <Typography {...tableHeaderStyle}>Nombre </Typography></TableCell>
              <TableCell align='left' style={{ minWidth: 20 }}> <Typography {...tableHeaderStyle}>Apellido </Typography></TableCell>
              <TableCell align='left' style={{ minWidth: 8 }}> <Typography {...tableHeaderStyle}>Número Documento </Typography></TableCell>
              <TableCell align='left' style={{ minWidth: 8 }}> <Typography {...tableHeaderStyle}>Tipo Documento </Typography></TableCell>
              <TableCell align='left' style={{ minWidth: 8 }}> <Typography {...tableHeaderStyle}>Fecha Nacimiento </Typography></TableCell>
              {/* {!isMediumDevice && <TableCell align='left' style={{ minWidth: 30 }}> Email </TableCell>} */}
              {/* {!isMediumDevice && <TableCell align='left' style={{ minWidth: 30 }}> Estado </TableCell>} */}
            </TableRow>
          </TableHead>

          <TableBody id='tbClient'>
            {props.clientes.map((row) => (
              <TablesClientRow key={row.idCliente}
                {...row}
                handleClickRow={handleClickRow}
                // isMediumDevice={isMediumDevice}
              />
            ))}
          </TableBody>

        </Table>
      </TableContainer>

      <Grid container  >
        <Grid item xs={8} >
          <TablePagination
            id='paginacionClientes'
            labelRowsPerPage="Filas"
            rowsPerPageOptions={isMediumDevice ? [] : [15, 25, 100]}
            component="div"
            count={props.clientesTotal}
            rowsPerPage={props.rowsPerPage}
            page={props.page}
            onPageChange={props.handleChangePage}
            onRowsPerPageChange={props.handleChangeRowsPerPage}
            backIconButtonProps={{id:'backPageButtonClients'}}
            nextIconButtonProps={{id:'nextPageButtonClients'}}
            SelectProps={{id:'selectRowsPropsClients'}}
          />
        </Grid>
      </Grid>
</>
    // </Paper>
  );
}
